import os, sys, json, base64, subprocess, hashlib, platform, time

HEAD  = "fe2f91edd9cf769e266a64c6ecf8cc3921ec31a1"
SHORT = "fe2f91e"
STAMP = "20260109172843"

WORK = "/kaggle/working"
os.makedirs(WORK, exist_ok=True)
os.makedirs(os.path.join(WORK,"tools"), exist_ok=True)

def wbytes(p, b):
    os.makedirs(os.path.dirname(p), exist_ok=True)
    with open(p, "wb") as f: f.write(b)

def wtext(p, s):
    os.makedirs(os.path.dirname(p), exist_ok=True)
    with open(p, "w", encoding="utf-8") as f: f.write(s)

SOLVER_B64 = ""
AUDIT_B64  = ""
PF_B64     = ""
OV_B64     = ""

wbytes(os.path.join(WORK,"solver.py"), base64.b64decode(SOLVER_B64))
wtext (os.path.join(WORK,"tools","__init__.py"), "")
wbytes(os.path.join(WORK,"tools","self_audit.py"), base64.b64decode(AUDIT_B64))
wbytes(os.path.join(WORK,"tools","passfail_arena.py"), base64.b64decode(PF_B64))
if OV_B64:
    wbytes(os.path.join(WORK,"tools","runtime_overrides.json"), base64.b64decode(OV_B64))

# solver hash
h = hashlib.sha256(open(os.path.join(WORK,"solver.py"),"rb").read()).hexdigest()
wtext(os.path.join(WORK,"solver_sha256.txt"), h + "\n")

# manifest
manifest = {
  "head": HEAD,
  "short": SHORT,
  "stamp": STAMP,
  "python": sys.version,
  "platform": platform.platform(),
  "time_utc": time.strftime("%Y-%m-%dT%H:%M:%SZ", time.gmtime()),
  "solver_sha256": h
}
wtext(os.path.join(WORK,"audit_manifest.json"), json.dumps(manifest, indent=2, sort_keys=True))

def run_cmd(cmd):
    p = subprocess.run(cmd, capture_output=True, text=True)
    return {"cmd": cmd, "rc": p.returncode, "stdout": p.stdout, "stderr": p.stderr}

# run gates
res = {}
res["self_audit"] = run_cmd([sys.executable, os.path.join(WORK,"tools","self_audit.py")])
res["passfail_arena"] = run_cmd([sys.executable, os.path.join(WORK,"tools","passfail_arena.py")])

# minimal predict-contract smoke
try:
    if WORK not in sys.path: sys.path.insert(0, WORK)
    import solver
    import polars as pl

    def clamp(x):
        try: x=int(x)
        except: x=0
        if x<0: x=0
        if x>999: x=999
        return x

    row = pl.DataFrame({"id":[1], "prompt":["Compute 2+2 and return integer only."]})
    prompts = row["prompt"].to_list()
    ans = [clamp(solver.solve(p)) for p in prompts]
    out = pl.DataFrame({"id":[1], "answer":ans})
    res["predict_contract"] = {"ok": True, "schema": {k:str(v) for k,v in out.schema.items()}, "preview": out.head(1).to_dict(as_series=False)}
except Exception as e:
    res["predict_contract"] = {"ok": False, "err": repr(e)}

wtext(os.path.join(WORK,"audit_results.json"), json.dumps(res, indent=2, sort_keys=True))

# readable summary
lines=[]
for k,v in res.items():
    if isinstance(v, dict) and "rc" in v:
        lines.append(f"== {k} ==")
        lines.append(f"rc={v['rc']}")
        if v.get("stdout"): lines.append("--- stdout ---\n"+v["stdout"][:12000])
        if v.get("stderr"): lines.append("--- stderr ---\n"+v["stderr"][:12000])
        lines.append("")
    else:
        lines.append(f"== {k} ==\n{json.dumps(v, indent=2)}\n")
wtext(os.path.join(WORK,"audit_summary.txt"), "\n".join(lines))

print("AUDIT_ARTIFACTS_WRITTEN")